package mp.bridgeSceneObject;
import tags301.Comp301Tags;
import util.annotations.Tags; 
import util.annotations.StructurePattern;
import util.annotations.StructurePatternNames;


@StructurePattern(StructurePatternNames.LINE_PATTERN)

@Tags(Comp301Tags.ROTATING_LINE)
public class ALine implements Line {

	static final int 
	INITIAL_X = 100, 
	INITIAL_Y = 100;


protected int x = INITIAL_X, y = INITIAL_Y; 

PolarPoint p; 

public ALine(double radius, double angle) {
	p = new APolarPoint(radius, angle); 
}

public ALine() {
	p = new APolarPoint(); 
}


@Override
public int getX() {return x;} 
@Override
public void setX(int val) {x = val; }
@Override
public int getY() { return y; }
@Override
public void setY(int val) {y = val; }

@Override
public int getWidth() {return p.getX();}
@Override
public int getHeight() {return p.getY();}
@Override
public void rotate(int val) {p.changeAngle((val* (Math.PI/16)) + p.getAngle());}
@Override
public void setRadius(double val) {p.setRadius(val);}
@Override
public void setAngle(double val) {p.changeAngle(val);}
@Override
public double getRadius() { return p.getRadius(); }
@Override 
public double getAngle() { return p.getAngle(); }
@Override
public void move(int x, int y) { this.x= x; this.y=y; } 

}

