package mp.bridgeSceneFigures;

import bus.uigen.OEFrame;
import bus.uigen.ObjectEditor;
import util.annotations.Visible;

public class ABetterBridgeScene extends ABridgeScene implements BetterBridgeScene {

	static final int X_KNIGHT=600, Y_KNIGHT=600, X_GUARD=800, Y_GUARD=600;
	static final Boolean INIT_BOOL= false; 
	protected Gorge aGorge; 
	protected Area aKnightArea, aGuardArea;
	protected Boolean occupied=INIT_BOOL, knightTurn=INIT_BOOL;
	protected Avatar activeKnight=arthur; 

	public ABetterBridgeScene() {
		aGorge = new Gorge(); 
		aKnightArea = new AnArea(X_KNIGHT, Y_KNIGHT); 
		aGuardArea = new AnArea(X_GUARD, Y_GUARD);
		readyGuard(); 
	}

	void readyGuard() { 
		guard.setPosition(xGuard(), yGuard());
	}

	public void approach() {
		if (!(getOccupied())) {
			//this.activeKnight = aKnight;
			this.activeKnight.setPosition(xKnight(), yKnight()); 
			this.occupied = true; 
		}
	}

	public void say(String text) {
		if (getOccupied() && !(getKnightTurn())) {
			guard.setChatBoxText(text);
		}
		else if (getOccupied()) {
			this.activeKnight.setChatBoxText(text);
		}
	};



	int xGuard() { return X_GUARD + (aGuardArea.getWidth() / 2); }
	int yGuard() { return Y_GUARD + (aGuardArea.getHeight() / 4); }
	int xKnight() { return X_KNIGHT + (aKnightArea.getWidth() / 2); }
	int yKnight() { return Y_KNIGHT + (aKnightArea.getHeight() / 4); }

	public Gorge getGorge() { return this.aGorge; }
	public Area getKnightArea() { return this.aKnightArea; }
	public Area getGuardArea() { return this.aGuardArea; } 
	public Boolean getOccupied() {return this.occupied; }
	public Boolean getKnightTurn() {return this.knightTurn;}
	@Visible(false)
	public Avatar getInteractingKnight() { return activeKnight; }
	public void passed() {
		if (getOccupied() && (!getKnightTurn())) {
			this.activeKnight.move(150, 0);
		}
	} 
	public void failed() {}

	public static void main(String[] args) {
		BridgeScene aBridgeScene = new ABetterBridgeScene(); 
		OEFrame anOEFrame = ObjectEditor.edit(aBridgeScene); 
		anOEFrame.showTreePanel();
	}
}

package lectures.inheritance.extra;
import java.util.Vector;

import lectures.arrays.collections_implementation.AStringHistory;
import lectures.inheritance.AnInheritingStringDatabase;
import util.models.VectorChangeEvent;
import util.models.VectorListener;
public class AnObservableStringSet extends AnInheritingStringDatabase {
	Vector<VectorListener> listeners = new Vector();
	public void addVectorListener(VectorListener vectorListener) {
		listeners.addElement(vectorListener);

	}
	public void addElement(String element) {
		super.addElement(element);
		notifyListeners(new VectorChangeEvent(this, VectorChangeEvent.AddComponentEvent, size -1, null, element, size));		
	} 
	public void removeElement(String element) {
		super.removeElement(element);
		notifyListeners(new VectorChangeEvent(this, VectorChangeEvent.DeleteComponentEvent, size + 1, null, element, size));		

	}
	void notifyListeners (VectorChangeEvent event) {
		for (int i = 0; i < listeners.size(); i++) {
			listeners.elementAt(i).updateVector(event);
		}

	}
}

