package mp.bridgeSceneObject;
import util.annotations.StructurePattern;
import util.annotations.StructurePatternNames;


@StructurePattern(StructurePatternNames.POINT_PATTERN) 
public class APolarPoint extends ALocatable implements PolarPoint {

	static final double INIT_RADIUS=100, INIT_ANGLE=100;


	protected double radius=INIT_RADIUS, angle=INIT_ANGLE;  

	public APolarPoint(double radius, double angle) {
		this.radius = radius;
		this.angle = angle; 
	}

	public APolarPoint() {

	}


	@Override
	public int getX() {return (int) (radius*Math.cos(angle));}
	@Override
	public int getY() {return (int) (radius*Math.sin(angle));}
	@Override
	public double getRadius() {return this.radius;}
	@Override
	public double getAngle() {return this.angle;}
	@Override
	public void changeAngle(double val) {this.angle = val;}
	@Override
	public void setRadius(double val) {this.radius = val;}

}

